import React from 'react'
import './card.css'

export default function Card({ title, text, image }) {
    return (
        <div className='movie-card'>
            <img className='movie-image' src={require(`./images/${image}`)} alt='' />
            <div>{title}</div>
            <div>{text}</div>
        </div>
    )
}
